import React from 'react';
import '../App.css';
import {socialLinks} from "./constants";
import styles, {layout} from "../style";

const Socials = () => {
  const socialItems = socialLinks.map( socialItem =>
    <a href={socialItem.link}>
      <img className={`w-[60px]`} src={socialItem.src} alt={socialItem.name} />
    </a>
  )

  return (
    <section id="socials" className={`${styles.paddingY}`}>
      <h2 className={`${styles.heading2}  flex flex-1`}>Socials</h2>
      <div className={`sm:py-32 py-16 flex flex-1 justify-center center-items justify-evenly relative`}>
        {socialItems}
        <div className="absolute z-[0] right-1/2 top-1 w-[50%] h-[50%]
          rounded-full  pink__gradient" />
        <div className="absolute z-[3] left-1/2 top-0 w-[50%] h-[50%]
          rounded-full  white__gradient" />
      </div>
    </section>
  )
}


export default Socials
